  false,\n\t\"url\": null,\n\t\"notes\": \"Austin Wateru2019s approved plant list
  specifies plants that may receive a new landscape/xeriscape watering schedule variance.
  A landscape must have xeric (low or very low water use) plants to receive the variance.
